import React from "react";

function ArticlesList() {
  return (
    <ul>
      Our latest articles...
      {articles.map(article => (
        <li key={article._id}>
          <ArticleCard article={article} key={article._id} />
        </li>
      ))}
    </ul>
  );
}

export default ArticlesList;
